                color: #FFFFFF;
                margin: 0;

            }

            /* Встроить шрифт Робото */

            &-lower {

                font-size: 1rem;
                line-height: 1.1875rem;
                color: #A3A3A3;
                margin: 0;

            }

        }

    }

}

@media (max-width: 1200px) {

    .header {

        &__nav {
            width: 100%;
            justify-content: space-around;
            margin-top: 1.25rem;
        }

        &__search--block {
            margin-right: 0;
        }

    }

    .banner {

        &__first--toplayer--content {
            width: 80%;
        }

        &__first--toplayer--text {
            font-size: 2.5rem;
        }
    }

}




